import './App.css';
import React from 'react';
import { useState } from 'react';

function App() {

  const [url, setUrl] = useState("");

  const getFormData = (e)=>{
    e.preventDefault();
  }
  return (
    <div>
      <form onSubmit={getFormData}>
        <input type='text' 
        onChange={(e)=> setUrl(e.target.value)} placeholder='paste the URL'></input>
        <button>submit</button>
      </form>
    </div>
  );
}

export default App;
